import React from 'react';
import './PageWrapper.css';

const SettingsPage = () => (
  <div className="page-wrapper center-content">
    <div className="glass-card">
      <h2>Settings</h2>
      <p>This page will hold app settings. Coming soon!</p>
    </div>
  </div>
);

export default SettingsPage;
